import "./styles.css";
import React, { Component } from "react";
import SideNavigationMenu from "./SideNavigationMenu";
import TodoApp from "./TodoApp";

export class Main extends Component {
  constructor() {
    this.state = { type: "Все" };
  }

  callBack = (type) => {};

  render() {
    return (
      <div className="mainContainer">
        <SideNavigationMenu />
        <TodoApp type={1} />
      </div>
    );
  }
}

export default Main;
